import style from "./Main.module.css";
import { NavLink } from "react-router-dom";
function ProfileMain(props) {
  return (
    <div className={style.profile_main}>
      <div className={style.title}>
        <div>GreenCosmic Study</div>
      </div>
      {props.isAuth ? (
        <div className={style.buttons}>
          <div>
            <NavLink to={"/courses"}>
              <div className={style.button}>
                <div>All Courses</div>
              </div>
            </NavLink>
          </div>
          <div>
            <div className={style.Nav}>Current Course:</div>
            <div className={style.button}>
              <div>{props.currentCourseName}</div>
              <div>
                <div>
                  {props.lessons.length > 0 ? (
                    <div>
                      {props.lessons.map((lesson) => (
                        <div className={style.lesson} key={lesson.id}>
                          {props.currentLessonName === lesson ? (
                            <div className={style.selected}>
                              {lesson.lessonName}
                            </div>
                          ) : (
                            <div className={style.unselected}>
                              {lesson.lessonName}
                            </div>
                          )}
                        </div>
                      ))}
                    </div>
                  ) : (
                    <div></div>
                  )}
                </div>
              </div>
            </div>
          </div>
        </div>
      ) : (
        <div className={style.greetings}>
          Good morning! We are glad to see you.
        </div>
      )}
    </div>
  );
}
export default ProfileMain;
